import React, { Component } from "react";
import { Container, Header } from "semantic-ui-react";

class Score extends Component {
  state = {};
  render() {
    return (
      <Container id="score">
        <Header>Score:</Header>
        <progress value="22" max="100"></progress>
      </Container>
    );
  }
}

export default Score;
